import React from "react";
import "../../App.css";
import Select from "react-select";

const skills = [
  { value: "Python", label: "Python" },
  { value: "Front-end", label: "Front-end" },
  { value: "Java", label: "Java" },
  { value: "Back-end", label: "Back-end" },
  { value: "UI/UX", label: "UI/UX" },
  { value: "ML/AI", label: "ML/AI" }
];

const prizes = [
  { value: "Best Hardware Hack", label: "Best Hardware Hack" },
  { value: "Best AI Hack", label: "Best AI Hack" },
  {
    value: "Best Magic Related or Humor Hack",
    label: "Best Magic Related or Humor Hack"
  },
  { value: " Best Rutgers Hack", label: " Best Rutgers Hack" },
  {
    value: "Best Use of Wolfram Language",
    label: "Best Use of Wolfram Language"
  },
  { value: "Best Car App", label: "Best Car App" }
];

class MyProfile extends React.Component {
  state = {
    selectedSkill: null,
    selectedPrize: null
  };
  // state = {
  //   selectedPrize: null
  // };

  handleSkillChange = selectedSkill => {
    this.setState({ selectedSkill }, () =>
      console.log(`Skills selected:`, this.state.selectedSkill)
    );
  };

  handlePrizeChange = selectedPrize => {
    this.setState({ selectedPrize }, () =>
      console.log(`Prize selected:`, this.state.selectedPrize)
    );
  };
  render() {
    const { selectedSkill } = this.state.selectedSkill;
    const { selectedPrize } = this.state.selectedPrize;

    return (
      <div className="App">
        <h1 className="App-header">
          MyProfile Component
          <div className="Drop-down">
            <Select
              value={selectedSkill}
              isMulti
              placeholder="Select Skills  ..."
              onChange={this.handleSkillChange}
              options={skills}
            />
          </div>
          <div className="Drop-down">
            <Select
              value={selectedPrize}
              isMulti
              placeholder="Select Prizes  ..."
              onChange={this.handlePrizeChange}
              options={prizes}
            />
          </div>
        </h1>
      </div>
    );
  }
}

export default MyProfile;
